-2-5", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVid Adrianopel \u00e4r ett l\u00e4ger \u003cb\u003euppslaget\u003c/b\u003e, hvarest alla\u003cbr\u003etrupper, sorn ej anv\u00e4ndas mot henden, skola samlas.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1829\u003cbr\u003egrouping: 1\u003cbr\u003eidentifier: bib11653828_18290103_144028_2_0004_alto.xml-2-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1157.5, "y": 1969.5}, {"color": "#4daf4a", "date": "1804", "id": "bib19225772_18041017_148004_121_0002_alto.xml-7-19", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eCavagcra \u00f6swer floden Sango, och marscherade uti 4 Quarres, f\u00f6r\u003cbr\u003eatt angripa Persiska L\u00e4grer, som war \u003cb\u003euppslaget\u003c/b\u003e wid byn\u003cbr\u003eKanagira, 7 werst bakom f\u00e4stningen Erivan, och hade framf\u00f6r sig de\u003cbr\u003efarligaste klippor.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1804\u003cbr\u003egrouping: 1\u003cbr\u003eidentifier: bib19225772_18041017_148004_121_0002_alto.xml-7-19\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1228.0, "y": 1168.0}, {"color": "#4daf4a", "date": "1806", "id": "bib19520388_18060521_147487_20_0002_alto.xml-1-13", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eF\u00f6rst Zizianoff begai stg till eit emellan K\u0026lt; inS l\u00e4ger och\u003cbr\u003estaden \u003cb\u003euppslaget\u003c/b\u003e t\u00e4lt, f\u00f6r att medSraVens Deputerade\u003cbr\u003eunderhandla; men dlef ivid intr\u00e4det i t\u00e4ltet af uagre l\u00f6nnm\u00f6rdare\u003cbr\u003e\u00f6fwerfallen och d\u00f6dad.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1806\u003cbr\u003egrouping: 1\u003cbr\u003eidentifier: bib19520388_18060521_147487_20_0002_alto.xml-1-13\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1083.9, "y": 1443.85}, {"color": "#4daf4a", "date": "1828", "id": "bib11653828_18280715_144028_159_0003_alto.xml-0-5", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGeneral Rudzewitschs l\u00e4ger, h\u00e4r \u003cb\u003euppslaget\u003c/b\u003e, och Hans\u003cbr\u003eMaj.t \u00e4rnar dr\u00f6ja h\u00e4r, till desi orm\u00f6n blifwit fullkomligen\u003cbr\u003ekoncentrerad.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1828\u003cbr\u003egrouping: 1\u003cbr\u003eidentifier: bib11653828_18280715_144028_159_0003_alto.xml-0-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1500.5, "y": 1627.1}, {"color": "#4daf4a", "date": "1895", "id": "bib15760690_18950216_145050_27_0003_alto.xml-122-23", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eh\u00e5ll kom den uppgiften, att det \u00e4nnu endast vore japanesernas\u003cbr\u003espioner, som hade uppn\u00e5tt Yalufioden, och att kinesernas l\u00e4ger vore\u003cbr\u003e\u003cb\u003euppslaget\u003c/b\u003e p\u00e5 30 engelska mils afst\u00e5nd p\u00e5 motsatta sidan.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760690_18950216_145050_27_0003_alto.xml-122-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1724.85, "y": 2160.85}, {"color": "#4daf4a", "date": "1895", "id": "bib15873371_18950327_145112_84_0003_alto.xml-17-8", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUtanf\u00f6r i  1042.25}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18950521_146365_118_0003_alto.xml-137-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMellanrikslagens uppstig liing har gifvit norska centerbladet \u00bb\u003cbr\u003eEidsvold \u00bb \u003cb\u003euppslag\u003c/b\u003e till en artikel i fr\u00e5 gan, af hvilken\u003cbr\u003eframg\u00e5r att man icke i Norge g\u00f6r sig stora f\u00f6rhoppningar \u00f6rn\u003cbr\u003e\u00e5stadkommande af en ny mellan rikslag, utan i st\u00e4llet f\u00f6ruts\u00e4tter\u003cbr\u003egenomg\u00e5ende tullkrig.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18950521_146365_118_0003_alto.xml-137-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1479.25, "y": 768.35}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18950426_146365_97_0002_alto.xml-57-51", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMeli ett faktum \u00e4r det och blir det att dessa unders\u00f6kningar\u003cbr\u003ealdrig kommit till st\u00e5nd och att herr Leist \u00e4nnu suttit som pascha i\u003cbr\u003eorubbadt bo \u2014 d\u00e4rest icke en tidskrift i Berlin beg\u00e5tt den \u00bb indi\u003cbr\u003eskretionen \u00bb att utan f\u00f6rfattarens vetskap offentligg\u00f6ra de\u003cbr\u003edagboksantecknin gar, hvilka g\u00e5fvo f\u00f6rsta \u003cb\u003euppslaget\u003c/b\u003e till\u003cbr\u003eprocessen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18950426_146365_97_0002_alto.xml-57-51\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1467.55, "y": 847.1}, {"color": "#377eb8", "date": "1895", "id": "bib19349359_18951112_148383_134_0002_alto.xml-37-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eTidningen Kalmar skrifver h\u00e4rom: Detta nya \u003cb\u003euppslag\u003c/b\u003e i en\u003cbr\u003efr\u00e5ga, som f\u00f6r v\u00e5r ort \u00e4r at s\u00e5 stor vigt, framkommer, synes det oss,\u003cbr\u003ep\u00e5 en ganska ol\u00e4mplig tidpunkt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19349359_18951112_148383_134_0002_alto.xml-37-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1735.8, "y": 494.9}, {"color": "#377eb8", "date": "1896", "id": "bib19277301_18961123_145146_97_0002_alto.xml-141-18", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNordensti\u00f6ld wore p\u00e4 det listigaste intresserad af den\u003cbr\u003eplanerade forstningsresan, och sade, att swensta sorstningsresande\u003cbr\u003egiswit \u003cb\u003euppslag\u003c/b\u003e till m\u00e4nga wetenstapliga landwinningar i\u003cbr\u003epolartrakterna.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277301_18961123_145146_97_0002_alto.xml-141-18\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1626.25, "y": 988.75}, {"color": "#377eb8", "date": "1896", "id": "bib15873936_18961212_147385_145_0003_alto.xml-137-6", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00e5mnet ocks\u00e5 v\u00e4l skickadt att gifva \u003cb\u003euppslag\u003c/b\u003e till de mest\u003cbr\u003evidunderliga och h\u00e5rresande utl\u00e4ggningar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18961212_147385_145_0003_alto.xml-137-6\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1369.3, "y": 1002.65}, {"color": "#377eb8", "date": "1895", "id": "bib15978012_18950304_148361_53_0001_alto.xml-56-18", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm penningarna voro borta, Nevitt m\u00f6rdad och Guy h\u00f6ll sig dold,\u003cbr\u003ehvem kunde veta hvilka nya \u003cb\u003euppslag\u003c/b\u003e, som v\u00e4ntade honom?\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15978012_18950304_148361_53_0001_alto.xml-56-18\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1874.2, "y": 476.9}, {"color": "#377eb8", "date": "1901", "id": "bib11653838_19010405_147024_14_0001_alto.xml-21-25", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eg\u00e5r ocks\u00e5 igen i landtbruksslyrelsens senast utkomna \u201d\u003cbr\u003eMeddelanden \u201d (som omfatta ber\u00e4ttelser l\u00f6r \u00e4r 1899), d\u00e4r p\u00e5 samma g\u00e5ng\u003cbr\u003egifves ett \u003cb\u003euppslag\u003c/b\u003e till vinnande af ett b\u00e4ttre sakernas\u003cbr\u003etillst\u00e5nd.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1901\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19010405_147024_14_0001_alto.xml-21-25\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1541.05, "y": 472.26}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950715_147683_189_0005_alto.xml-16-39", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eallts\u00e5 god tid att samla v\u00e5ra tankar och ge \u0027 norng\u00e5 i minnet\u003cbr\u003ede lyckliga dagar vi upplef vat under denna minnesrika eskadersegling\u003cbr\u003etill Finland, hvilken, det vilja vi hoppas, skall efterf\u00f6ljas af flera\u003cbr\u003eooh gifva \u003cb\u003euppslaget\u003c/b\u003e till liflig samf\u00e4rdsel mellan svenska ooh\u003cbr\u003efinska segels\u00e4llskap.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950715_147683_189_0005_alto.xml-16-39\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1868.3, "y": 1041.3}, {"color": "#377eb8", "date": "1895", "id": "bib11653815_18950917_146944_110_0002_alto.xml-6-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEtt nytt \u003cb\u003euppslag\u003c/b\u003e till l\u00f6sningen af den mycket omskrifna\u003cbr\u003esockerfabriksfr\u00e5gan l\u00e4r i fredags hafva blifvit dr\u00e4gt \u00e5 bane.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18950917_146944_110_0002_alto.xml-6-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1543.0, "y": 691.3}, {"color": "#377eb8", "date": "1895", "id": "bib19227291_18950417_145289_45_0002_alto.xml-134-12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen jast derf\u00f6r synes antagligt, att vid behandlingen inom\u003cbr\u003ekamrarne n\u00e5got \u003cb\u003euppslag\u003c/b\u003e kommer fram, hvarigenom enighet vinnes\u003cbr\u003eom operationsplanen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18950417_145289_45_0002_alto.xml-134-12\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1688.85, "y": 1119.95}, {"color": "#377eb8", "date": "1896", "id": "bib15873936_18960418_147385_45_0003_alto.xml-29-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMan anm\u00e4rker, att regeringens f\u00f6rslag inneh\u00e5ller \u003cb\u003euppslag\u003c/b\u003e\u003cbr\u003esora l\u00e4tt kunna bli farliga.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18960418_147385_45_0003_alto.xml-29-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1577.7, "y": 999.0}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950119_144022_16_0007_alto.xml-52-28", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eStyrelsen \u00e5ligger ocks\u00e5 att p\u00e5 b\u00e4sta s\u00e4tt solea \u00f6fvervaka\u003cbr\u003etillg\u00e5ngen p\u00e5 goda bost\u00e4der f\u00f6r ar hetare i Ooteborg samt\u003cbr\u003ehyresbeloppens stigande och fallande \u00e4fvensom egna uppm\u00e4rksamhet \u00e5l\u003cbr\u003enya \u003cb\u003euppslag\u003c/b\u003e p\u00e5 arbelarebostadsv\u00e4sendets f\u00e4lt samt \u00e5rligen d\u00e4rom\u003cbr\u003etill f\u00f6reningen afgifva ber\u00e4ttelse \u00bb.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950119_144022_16_0007_alto.xml-52-28\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1458.5, "y": 696.75}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950202_145112_33_0003_alto.xml-185-4", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eM\u00f6jligen f\u00f6religger dock b\u00e4r \u003cb\u003euppslag\u003c/b\u003e tiil en annan\u003cbr\u003ef\u00f6rbrytelsehistoria.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950202_145112_33_0003_alto.xml-185-4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1708.3, "y": 1188.25}, {"color": "#377eb8", "date": "1902", "id": "bib11653811_19021022_145317_162_0002_alto.xml-139-28", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003etillfallande andelen af 25 \u00f6restill\u00e4gget ber\u00e4knades till 10 i\u003cbr\u003est\u00e4llet f\u00f6r 15 \u00f6re, hade de nog f\u00e5tt ers\u00e4ttning f\u00f6r eventuell\u003cbr\u003esjunkning af oms\u00e4ttningen. \u00bb Ett nytt \u003cb\u003euppslag\u003c/b\u003e: i S\u00f6dert\u00e4lje\u003cbr\u003edonationsjordsfr\u00e5ga.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19021022_145317_162_0002_alto.xml-139-28\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1218.1, "y": 581.9}, {"color": "#377eb8", "date": "1895", "id": "bib19349359_18950330_148383_38_0002_alto.xml-4-4", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eordagrannt:\u201c Ett \u003cb\u003euppslag\u003c/b\u003e till unionsfred l\u00e4r under den\u003cbr\u003eallra n\u00e4rmaste tiden v\u00e4ntas i form af k. propositioner till svenska\u003cbr\u003eriksdagen och norska stortinget.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19349359_18950330_148383_38_0002_alto.xml-4-4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2043.95, "y": 890.85}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950720_144022_166_0006_alto.xml-203-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ef\u00e4r hoppas, att det \u003cb\u003euppslag\u003c/b\u003e om gemensamma\u003cbr\u003eostlagiingslokaler, som gafs vid f\u00f6rra mejeristm\u00f6tet och som s\u00e5\u003cbr\u003elifligt diskuterades vid det innevarande \u00e5r f\u00f6rsamlade, skall l\u00f6sas p\u00e5\u003cbr\u003eett tillfredsst\u00e4llande satt samt visa sig kunna realisera de vid\u003cbr\u003edetsamma f\u00e4sta f\u00f6rhoppningarna.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950720_144022_166_0006_alto.xml-203-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1738.9, "y": 596.1}, {"color": "#377eb8", "date": "1899", "id": "bib11653790_18990210_145648_11_0002_alto.xml-39-9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet kan h\u00e4nda, att vi nu st\u00e5 vid \u003cb\u003euppslaget\u003c/b\u003e till en\u003cbr\u003efastare rikspolitik, och att de tecken till mera f\u00f6rtroendefullt\u003cbr\u003esamarbete mellan regeringen och v\u00e5rt b\u00e4st organiserade h\u00f6gerparti inom\u003cbr\u003eriksdagen, som de senaste veckornas politiska tilldragelser synas\u003cbr\u003einneb\u00e4ra, \u00f6ppna f\u00f6r oss utsikter till, att man nu omsider beslutit sig\u003cbr\u003ef\u00f6r att g\u00f6ra halt och front p\u00e5 eftergifternas v\u00e4g.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1899\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18990210_145648_11_0002_alto.xml-39-9\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1311.65, "y": 781.2}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18950611_146365_134_0003_alto.xml-130-46", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePl\u00f6tsligen uppt\u00e4ckte de att r\u00f6k tr\u00e4ngde upp genom sir\u00f6n vid\u003cbr\u003en\u00e5gra stenklippor ett stycke ofvanf\u00f6r ing\u00e5ngen, hvarvid en af\u003cbr\u003es\u00e4llskapet p\u00e5 sk\u00e4mt yttrade: \u00bb m\u00e5nne bj\u00f6rnfar t\u00e4nker bjuda oss p\u00e5\u003cbr\u003ekaffe, efter som lian synes elda? \u00bb Emellertid var h\u00e4rigenom ett nytt\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e att f\u00e5 fram nalle gifvet, oell utan att inv\u00e4nta den\u003cbr\u003eborts\u00e4nde kamratens \u00e5terkomst, skred man raskt till verket, Sn\u00f6n p\u00e5\u003cbr\u003est\u00e4llet, diir krutr\u00f6ken letat sig nt, undankrafsades, och h\u00e4r fanns en\u003cbr\u003edjup remna, hvilken ledde rakt ned i berget, H\u00e4r giillde att platsera\u003cbr\u003esig r\u00e4tt, ifall nalle skulle f\u00f6retaga ett utfall, hvilket vore att\u003cbr\u003ef\u00f6rmoda, d\u00e4 man hade utsikt att n\u00e5 honom med en kula i sjiilfva\u003cbr\u003es\u00e4ngkammaren.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18950611_146365_134_0003_alto.xml-130-46\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2063.7, "y": 961.5}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950322_145112_80_0002_alto.xml-159-4", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eAnledniDgen till detta nya \u003cb\u003euppslag\u003c/b\u003e till cirkusf\u00f6retag\u003cbr\u003eder p\u00e5 platsen l\u00e4r vara den, att ridhuset blifvit uthyrdt till cirkus\u003cbr\u003eMadigan f\u00f6r denna tid.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950322_145112_80_0002_alto.xml-159-4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1406.75, "y": 912.9}, {"color": "#377eb8", "date": "1895", "id": "bib15650837_18951216_146391_293_0003_alto.xml-113-0", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cb\u003eUppslaget\u003c/b\u003e till ett dylikt, h\u00f6gtidligare sammantraffand \u00bb\u003cbr\u003eskedde f\u00f6r fem \u00e5r sedan eller den 15 December 1890, d\u00e5 f. d.\u003cbr\u003eofficerare vid regemetnet g\u00e5fvo middag f\u00f6r den dl nyligen afg\u00e5ogce\u003cbr\u003eregementschefen, generalmajoren friherre Carl Melker Lagerfelt,\u003cbr\u003ehvarvid \u00f6fverenskommelse tr\u00e4ffades, att f\u00f6r v\u00e4nskaps ooh kamratandas\u003cbr\u003ebibeh\u00e5llande oob npplifvande dem emellan do hvarje femte \u00e5r p\u00e5 samma\u003cbr\u003edag skulla samlas p\u00e5 middag, uti hvilken do, som under qvirqvenniets\u003cbr\u003ef\u00f6rlopp tagit aLkc\u0026lt; d, \u00e4fven borde anmodas deltags.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650837_18951216_146391_293_0003_alto.xml-113-0\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1545.9, "y": 824.2}, {"color": "#377eb8", "date": "1903", "id": "bib11653790_19030508_12541_35_0004_alto.xml-96-13", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00f6rn, att lektionen ej i egentlig mening gifvit anledning till\u003cbr\u003en\u00e5got nytt \u003cb\u003euppslag\u003c/b\u003e i religionsundervisningen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1903\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_19030508_12541_35_0004_alto.xml-96-13\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1538.15, "y": 1213.25}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18951124_147683_321_0004_alto.xml-50-0", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cb\u003eUppslaget\u003c/b\u003e till den norska students\u00e5ngf\u00f6reningen gafs af\u003cbr\u003edet f\u00f6rsta skandinaviska studentm\u00f6tet i Lund och K\u00f6penhamn \u00e5r\u003cbr\u003e1845.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18951124_147683_321_0004_alto.xml-50-0\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1501.35, "y": 526.9}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18950601_147640_126_0004_alto.xml-6-71", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm \u2014 det Gud f\u00f6rbjude \u2014 v\u00e5rfesterna p\u00e5 Skansen skulle blifva\u003cbr\u003emindre popul\u00e4ra (fast det f\u00f6rst\u00e5s att publiken \u00e4r en mycket nyckfull\u003cbr\u003epjes, knapt mindre nyckfull \u00e4n qvinnan, \u00f6rn hvilken de gamla sade:\u003cbr\u003evarium ac mutabile semper femina) \u2014 sorn sagdt, \u00f6rn den dagen skulle\u003cbr\u003ekomma, att v\u00e5rfesterna icke l\u00e4ngre g\u00e5, s\u00e5 kunde det i denna d:r\u003cbr\u003eHazelius \u2019 otur med v\u00e4dret blifva \u003cb\u003euppslag\u003c/b\u003e till en ny\u003cbr\u003einkomstk\u00e4lla.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18950601_147640_126_0004_alto.xml-6-71\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1873.25, "y": 316.13}, {"color": "#377eb8", "date": "1898", "id": "bib11653790_18980812_145648_61_0005_alto.xml-12-12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eindustriidkare och handtverkare under det kommande \u00e5ret, med\u003cbr\u003edess v\u00e4ntade vigtiga \u003cb\u003euppslag\u003c/b\u003e i dem n\u00e4ra r\u00f6rande angel\u00e4genheter,\u003cbr\u003eha nytta af att l\u00e4sa Helsingborgs-Posten.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1898\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18980812_145648_61_0005_alto.xml-12-12\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1617.9, "y": 445.38}, {"color": "#377eb8", "date": "1903", "id": "bib11653811_19031019_145317_162_0001_alto.xml-62-36", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDetta har visserligen alls icke den omfattande och generella\u003cbr\u003ebetydelse, som f\u00f6rst uppgafs, men \u00e4r i alla fall ett m\u00e4rkligt steg\u003cbr\u003efram\u00e5t mot det m\u00e5l, som f\u00f6resv\u00e4fvade tsar Nicolaus, d\u00e5 han gaf\u003cbr\u003e\u003cb\u003euppslaget\u003c/b\u003e till fredskongressen i Haag.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1903\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19031019_145317_162_0001_alto.xml-62-36\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1531.95, "y": 328.225}, {"color": "#377eb8", "date": "1897", "id": "bib11653790_18971221_145648_100_0003_alto.xml-249-13", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eindustriidkare och handtverkare lin der det kommande \u00e5ret, nied\u003cbr\u003edess v\u00e4ntade vigtiga \u003cb\u003euppslag\u003c/b\u003e i dem n\u00e4ra r\u00f6rande angela\u003cbr\u003egenheter, lia nytta af att l\u00e4sa Helsingborgs Posten.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18971221_145648_100_0003_alto.xml-249-13\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2029.9, "y": 472.095}, {"color": "#377eb8", "date": "1896", "id": "bib15873936_18960204_147385_14_0002_alto.xml-70-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eS\u00e5som man genast ser, har man h\u00e4r f\u00f6r sig \u003cb\u003euppslaget\u003c/b\u003e tili\u003cbr\u003eomfattande riksdagsstrider, hvilka icke torde komma att hinna sin\u003cbr\u003eafslutning i br\u00e5dkastet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18960204_147385_14_0002_alto.xml-70-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1470.95, "y": 920.8}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950303_147683_61_0002_alto.xml-10-9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eblef nu ocks\u00e5 hufvudm\u00e5iet f\u00f6r bans str\u00e4fvanden och gaf\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e till en rad f\u00f6rs\u00f6k att inf\u00f6ra den europeiska\u003cbr\u003ecivilisationen i Egyp ten.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950303_147683_61_0002_alto.xml-10-9\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1555.65, "y": 937.4}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950607_145112_152_0003_alto.xml-4-31", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003efruktar, att veastern vill fuska bort de afsedda\u003cbr\u003eunderhandlingarna derigenom, att dess ledande m\u00e4n f\u00f6rtolka detsamma\u003cbr\u003eeller g\u00f6ra till\u00e4gg, som f\u00f6r\u00e4ndra dess karakt\u00e4r och g\u00f6ra det endast\u003cbr\u003etill \u003cb\u003euppslag\u003c/b\u003e tor en \u00bb skent\u00f6rhandling \u00bb Jetta \u00e4r, som bekant,\u003cbr\u003eocks\u00e5 de flestes tanke h\u00e4r i landet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950607_145112_152_0003_alto.xml-4-31\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1622.5, "y": 827.75}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18951128_147640_278_0003_alto.xml-141-13", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00e4r det helt enkelt endast detta samtal, som p\u00e5 n\u00e5got s\u00e4tt\u003cbr\u003egifvit \u003cb\u003euppslag\u003c/b\u003e till liela ryktet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18951128_147640_278_0003_alto.xml-141-13\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1657.0, "y": 599.7}, {"color": "#377eb8", "date": "1895", "id": "bib19225758_18950124_144022_20_0003_alto.xml-203-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMariestad: Detta l\u00e5ngvariga m\u00e5l har nu f\u00e5tt ett nytt\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19225758_18950124_144022_20_0003_alto.xml-203-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1450.85, "y": 351.025}, {"color": "#377eb8", "date": "1902", "id": "bib11653811_19021115_145317_176_0002_alto.xml-112-9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMan kan icke neka, att detta f\u00f6rh\u00e5llande ger \u003cb\u003euppslag\u003c/b\u003e\u003cbr\u003etill m\u00e5ngahanda tankar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19021115_145317_176_0002_alto.xml-112-9\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1413.65, "y": 808.5}, {"color": "#377eb8", "date": "1895", "id": "bib15760600_18950604_146401_65_0003_alto.xml-146-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eeligion, myteologi och Teologi \u00e4fvensom den sj\u00e4tte Ett nytt\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e framh\u00e5lla den m\u00e4rkliga \u00f6fverensst\u00e4mmelsen, som\u003cbr\u003ef\u00f6refinnes mellan den fornnordiska gudal\u00e4rans detaljer oell \u00e5tskilliga\u003cbr\u003edelar af gamla testamentet samt medeltidens kristna legender.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15760600_18950604_146401_65_0003_alto.xml-146-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1451.15, "y": 283.5}, {"color": "#377eb8", "date": "1902", "id": "bib11653811_19020315_145317_41_0002_alto.xml-176-32", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00bb Signaturen Petter Frisk, som p\u00e5 det medborgerliga, ej mindre\u003cbr\u003e\u00e4n p\u00e5 andra gebiet har mycket omv\u00e4xlande och lifliga impulser, har\u003cbr\u003euppkallats af bagerilockouten till ett kraftigt eggande socialt\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19020315_145317_41_0002_alto.xml-176-32\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1766.25, "y": 1132.7}, {"color": "#377eb8", "date": "1895", "id": "bib15650814_18950729_146365_174_0002_alto.xml-18-20", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003el\u00f6sningsv\u00e4g har redan vunnit s\u00e5dant insteg hos de under\u003cbr\u003erustningarnas b\u00f6rdor dignande folken, att det betyder mindre,\u003cbr\u003ehvarifr\u00e5n \u003cb\u003euppslaget\u003c/b\u003e kommer, \u00e4n att det h\u00e5res fram med all den\u003cbr\u003e\u00e4rliga kraft, som saken f\u00f6rtj\u00e4nar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650814_18950729_146365_174_0002_alto.xml-18-20\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1795.65, "y": 769.15}, {"color": "#377eb8", "date": "1900", "id": "bib11653838_19000406_147024_14_0001_alto.xml-37-46", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003etillfredsst\u00e4llelse skall man \u00e4fven mottaga budskapet \u00f6rn, att\u003cbr\u003eden f\u00f6rste jordbruksmimsiern blifvit landsh\u00f6fding Odelberg, en b\u00e5de i\u003cbr\u003eteoretiskt och praktiskt h\u00e4nseende framst\u00e5ende och insiktsfull\u003cbr\u003ejordbrukare, hvilken derjemte s\u00e5som \u00f6fverdirekt\u00f6r l\u00f6r den nyskapade\u003cbr\u003eiandtbruksstyrelsen visade sig som en dugande administrat\u00f6r och m\u00e4ktig\u003cbr\u003eaf goda \u003cb\u003euppslag\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1900\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19000406_147024_14_0001_alto.xml-37-46\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1282.5, "y": 1046.4}, {"color": "#377eb8", "date": "1895", "id": "bib15975087_18950102_145596_1_0004_alto.xml-12-74", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSedan dessa l\u00f6pande \u00e4renden blifvit afgjorda, f\u00f6retogs till\u003cbr\u003ebehandling den f\u00f6r m\u00f6tet uppst\u00e4llda fr\u00e5gan: \u00bb Har prosten Janssons\u003cbr\u003eupptr\u00e4dande mot helnykterheten gagnat eller skadat nykterhetssaken? \u00bb\u003cbr\u003eEfter att hafva \u00f6fverenskommit \u00f6rn att diskussionen \u00f6fver den\u003cbr\u003euppst\u00e4llda fr\u00e5gan skulle forts\u00e4ttas under e. m. ocks\u00e5, en\u00e4r f\u00f6redrag\u003cbr\u003ekomme att h\u00e5llas af hr Sj\u00f6 vid kl. 12 p\u00e5 dagen, l\u00e4mnade hr Hultkvist\u003cbr\u003een historik \u00f6fver krogstriden i Sundbyberg, hvilken gaf \u003cb\u003euppslag\u003c/b\u003e\u003cbr\u003etill den riksbekanta striden mellan prosten Jansson och\u003cbr\u003ehelnykterhetsv\u00e4n-\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15975087_18950102_145596_1_0004_alto.xml-12-74\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1570.55, "y": 777.0}, {"color": "#377eb8", "date": "1899", "id": "bib11653811_18990904_145317_135_0002_alto.xml-6-26", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003emitt hjerta, m\u00e5ste nu f\u00e5 ett uttryck Det f\u00f6rv\u00e5nar mig, att\u003cbr\u003el\u00e4rarne vid rikets allm\u00e4nna l\u00e4roverk, hvilka vi s\u00e4kert r\u00e4knade p\u00e5, d\u00e5\u003cbr\u003e\u003cb\u003euppslaget\u003c/b\u003e till sommarkurserna gafs, icke kommit \u2014 vid\u003cbr\u003ef\u00f6reg\u00e5ende kurser ett f\u00e5tal, vid denna endast en.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1899\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_18990904_145317_135_0002_alto.xml-6-26\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1653.2, "y": 751.5}, {"color": "#377eb8", "date": "1903", "id": "bib11653790_19030310_12541_19_0002_alto.xml-118-1", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eF\u00f6rsta \u003cb\u003euppslaget\u003c/b\u003e i nu f\u00f6religgande fr\u00e5ga har gjorts af\u003cbr\u003e\u00e4garen till f\u00f6ren\u00e4mda j\u00e4rnv\u00e4g, Falun \u2014 V\u00e4st erd alar nes\u003cbr\u003ej\u00e4rnv\u00e4gsaktleboiag, som genom sin styrelse, landsh\u00f6fdingen C1f.\u00f63\u003cbr\u003eWarsell, disponenten E.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1903\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_19030310_12541_19_0002_alto.xml-118-1\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1620.75, "y": 1143.3}, {"color": "#377eb8", "date": "1896", "id": "bib19227291_18960421_145289_48_0002_alto.xml-67-58", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMed anledning h\u00e4raf, och d\u00e5 det, f\u00f6r f\u00f6retagets genomf\u00f6rande,\u003cbr\u003eicke blott \u00e4r n\u00f6digt, att n\u00e5gon dertill tager initiativ, utan torde\u003cbr\u003evara f\u00f6retr\u00e4desvis l\u00e4mpligt, att detta tages af den myndighet, som\u003cbr\u003en\u00e4rmast har att tillgodose samh\u00e4llets intressen, s\u00e5mycket mera som,\u003cbr\u003ederest flyttningen skulle lemn\u00e4s beroende i f\u00f6rsta hand p\u00e5 n\u00e5got\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e fr\u00e5n k. jernv\u00e4gsstyrelsens och statens sida, f\u00f6retaget\u003cbr\u003ekunde l\u00f6pa fara att, i konkurrens med andra likartade allm\u00e4nna behof,\u003cbr\u003eunder l\u00e4ngre, oviss tid undanskjutas, till\u00e5ter jag mig h\u00e4rigenom\u003cbr\u003ev\u00f6rdsamt f\u00f6resl\u00e5, att.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18960421_145289_48_0002_alto.xml-67-58\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1687.8, "y": 680.1}, {"color": "#377eb8", "date": "1902", "id": "bib11653811_19021201_145317_185_0002_alto.xml-101-12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eett \u00e5r sedan i Lidk\u00f6pingstrakten lyckade f\u00f6rs\u00f6ksodlingen af\u003cbr\u003esockerbetor, som gifvit \u003cb\u003euppslag\u003c/b\u003e till denna f\u00f6r Vesterg\u00f6tlands\u003cbr\u003enya industri.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19021201_145317_185_0002_alto.xml-101-12\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1751.0, "y": 734.35}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18951114_147683_311_0003_alto.xml-42-34", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen f\u00f6rh\u00e5llandet \u00e4r i sjelfva verket \u2014 alldeles motsatt F\u00f6r att\u003cbr\u003efinna detta beh\u00f6fver man blott erinra sig inneh\u00e5llet af den beklagliga\u003cbr\u003eartikel i Nya Dagligt Allehanda den 31 sistlidne juli, som gaf\u003cbr\u003e\u003cb\u003euppslaget\u003c/b\u003e till hela agitationen och angaf dess m\u00e5l.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18951114_147683_311_0003_alto.xml-42-34\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1959.4, "y": 394.845}, {"color": "#377eb8", "date": "1895", "id": "bib19227291_18950427_145289_50_0002_alto.xml-91-100", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e4r de akademiska myndigheterna inkommo till kongl, majit med\u003cbr\u003edenna sin framst\u00e4llning ocb, p\u00e5 samma g\u00e5ng de erinrade om sin\u003cbr\u003eupprepade g\u00e5nger framst\u00e4ldu beg\u00e4ran \u00f6rn att f\u00e5 eo ny professur,\u003cbr\u003etillika framst\u00e4lde det alternativet, att fakulteten \u00e5tminstone m\u00e5tte\u003cbr\u003eerh\u00e5lla 1,500 kronor f\u00f6r att kunna tillf\u00e4lligt f\u00f6rst\u00e4rka\u003cbr\u003earbetskrafterna inom fakulteten, s\u00e5 betraktade jag f\u00f6r min del detta\u003cbr\u003esenare f\u00f6rslag s\u00e5som en sak, f\u00f6rtjent af s\u00e4rskild uppm\u00e4rksamhet med\u003cbr\u003eh\u00e4nsyn till den besparing i kostnad, sorn derigenom skulle uppst\u00e5 f\u00f6r\u003cbr\u003estatsverket, och \u00e4fven p\u00e5 grund af andra f\u00f6rh\u00e5llanden an s\u00e5g jag det\u003cbr\u003es\u00e5som ett lyckligt \u003cb\u003euppslag\u003c/b\u003e till fr\u00e5gans provisoriska\u003cbr\u003el\u00f6sning.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18950427_145289_50_0002_alto.xml-91-100\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1336.45, "y": 862.05}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18950322_147640_69_0002_alto.xml-193-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003esorn i \u003cb\u003euppslaget\u003c/b\u003e f\u00f6reter en viss likhet med en ledande\u003cbr\u003euppsats i en radikal Stockholmstidning, men komplett skiljer sig fr\u00e5n\u003cbr\u003edenna genom sin st\u00e4llning mot norska venstern, bland annat f\u00f6ljande,\u003cbr\u003esom vi \u00e5tergifva med tidningens egna kursiveringar: Statsministern\u003cbr\u003eBostr\u00f6ms politik har icke varit utan sina djerfva v\u00e4ndningar och raska\u003cbr\u003ehandgrepp.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18950322_147640_69_0002_alto.xml-193-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2105.35, "y": 852.8}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950202_147683_32_0004_alto.xml-107-4", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eM\u00f6jligen f\u00f6religger dock h\u00e4r \u003cb\u003euppslag\u003c/b\u003e till en annan\u003cbr\u003ef\u00f6rbrytelsehistoria.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950202_147683_32_0004_alto.xml-107-4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1304.95, "y": 372.09}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950928_147683_264_0006_alto.xml-82-44", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003edet intrycket \u2014 s\u00e5 litet der \u00e4n s\u00e4ges \u2014 d\u00e5 man l\u00e4st den, att\u003cbr\u003ef\u00f6rfattaren \u00e4fven skulle godk\u00e4nna ett maktbruk emot Norge \u00bb s\u00e5 gorna\u003cbr\u003ef\u00f6rst sorn sist \u00bb \u2014 n\u00e5got som tyckes framg\u00e5 af slutorden, \u00bb i alla\u003cbr\u003eh\u00e4ndelser \u00e4r dock \u003cb\u003euppslaget\u003c/b\u003e till ofreden icke kommet fr\u00e5n\u003cbr\u003eSverige \u00bb.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950928_147683_264_0006_alto.xml-82-44\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2036.05, "y": 386.005}, {"color": "#377eb8", "date": "1895", "id": "bib15873936_18950404_147385_41_0003_alto.xml-149-23", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMisstankarne mot h\u00e4ktade Westermark-Ros\u00e9n f\u00f6r delaktighet i\u003cbr\u003emordet anses ej undanr\u00f6jda genom senaste upplysningar, utan\u003cbr\u003espaningarna komma att fullf\u00f6ljas efter det gifna\u003cbr\u003e\u003cb\u003euppslaget\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18950404_147385_41_0003_alto.xml-149-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1436.65, "y": 565.3}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950704_147683_178_0004_alto.xml-44-3", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDetta var f\u00f6reta \u003cb\u003euppslaget\u003c/b\u003e till G\u00f6ta- och Trollh\u00e4tte\u003cbr\u003ekunaler.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950704_147683_178_0004_alto.xml-44-3\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1714.15, "y": 1029.95}, {"color": "#377eb8", "date": "1896", "id": "bib11653830_18960608_146968_46_0003_alto.xml-97-14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ekanske f\u00f6rn\u00e4msta betydelse \u00e4r s\u00e5lunda den, att den kommer att\u003cbr\u003eblifva ett nytt \u003cb\u003euppslag\u003c/b\u003e i den arktiska forskningens\u003cbr\u003ehistoria.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653830_18960608_146968_46_0003_alto.xml-97-14\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1371.4, "y": 635.65}, {"color": "#377eb8", "date": "1896", "id": "bib15873936_18960118_147385_7_0004_alto.xml-61-17", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI F\u00e4derna, en af ett m\u00e4ktigt patos buren dikt, samlingens\u003cbr\u003ef\u00f6rsta, finna vi liksom \u003cb\u003euppslaget\u003c/b\u003e till de f\u00f6ljande.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873936_18960118_147385_7_0004_alto.xml-61-17\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1633.65, "y": 922.5}, {"color": "#377eb8", "date": "1895", "id": "bib15975090_18950209_148377_17_0003_alto.xml-29-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eanledningen och \u003cb\u003euppslaget\u003c/b\u003e till en omhv\u00e4lfvning inom\u003cbr\u003ehush\u00e5llningen, som s\u00f6ker sin like.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15975090_18950209_148377_17_0003_alto.xml-29-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1342.9, "y": 1095.75}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950329_147683_86_0003_alto.xml-139-31", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUnder dot vackra f\u00f6reb\u00e4randet, att tidningen tror sig i de\u003cbr\u003ev\u00e4ntade \u00bb f\u00f6rslagen \u00bb (om hvilka ingen vet eller kan veta n\u00e5gonting)\u003cbr\u003ehafva p\u00e4 f\u00f6rhand sp\u00e5rat ett \u00bb \u003cb\u003euppslag\u003c/b\u003e till en unionsfrod \u00bb,\u003cbr\u003etager hon sig f\u00f6ro att antyda de vilkor, p\u00e5 hvilka denna unionsfred\u003cbr\u003eskulle slutas.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950329_147683_86_0003_alto.xml-139-31\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1811.3, "y": 891.1}, {"color": "#377eb8", "date": "1897", "id": "bib11653815_18970127_146944_10_0003_alto.xml-11-12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSundsvallsposten meddelar \u2014 med anled\u0026lt; ning al uppgiiten,\u003cbr\u003eatt nya \u003cb\u003euppslag\u003c/b\u003e situUc hafva funnits i Johanssonska r\u00e5nmordet\u003cbr\u003eoch att m\u00e5let skulle \u00e5terupptagas -- att \u0027 en arbetare Uddenberg\u003cbr\u003eanm\u00e4lt, att han varit med p\u00e5 samma t\u00e5g som m\u00f6rdade tr\u00e4varuhandlaren\u003cbr\u003eJohansson oell Westermark-Ros\u00e9n.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653815_18970127_146944_10_0003_alto.xml-11-12\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1281.0, "y": 479.055}, {"color": "#377eb8", "date": "1896", "id": "bib19227291_18960307_145289_29_0002_alto.xml-16-7", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eG\u00e5fvan af detta album torde blifva ett \u003cb\u003euppslag\u003c/b\u003e till\u003cbr\u003ef\u00f6rverkligandet af en tanke, som ofta framkastats, n\u00e4mligen att f\u00f6r\u003cbr\u003eriksdagsbiblioteket anskaffa en \u00e5tminstone n\u00e5gorlunda fullst\u00e4ndig\u003cbr\u003esamling fotografiportr\u00e4tt af afg\u00e5ngne och nuvarande riksm\u00e4n, sedan\u003cbr\u003etiden f\u00f6r det nya representationsskickets b\u00f6rjan.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18960307_145289_29_0002_alto.xml-16-7\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1440.05, "y": 485.33}, {"color": "#377eb8", "date": "1899", "id": "bib11653790_18991003_145648_77_0002_alto.xml-11-23", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u00e4ro \u00e5 bane omfattande j\u00e4rnv\u00e4gsanl\u00e4ggningar, hvilka, n\u00e4r de en\u003cbr\u003eg\u00e5ng blifva fullbordade, skola med \u0027 \u00f6ra nyttiga omgestaltningar och\u003cbr\u003egifva \u003cb\u003euppslag\u003c/b\u003e till nya f\u00f6retag i skilda riktnmgar f\u00f6r\u003cbr\u003etillgodog\u00f6rande af Dalarnes rika naturliga tilg\u00e5ngar.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1899\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18991003_145648_77_0002_alto.xml-11-23\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1567.0, "y": 641.45}, {"color": "#377eb8", "date": "1896", "id": "bib15650835_18961127_146472_186_0002_alto.xml-29-25", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGeneralintendenten Thor\u00e9ns afsked har gifvit anledning till s\u00e5\u003cbr\u003em\u00e5nga uppgifter och kommentarier, att det sannerligen \u00e4r ytterst sv\u00e5rt\u003cbr\u003eatt h\u00e4r komma med n\u00e5got nytt \u003cb\u003euppslag\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15650835_18961127_146472_186_0002_alto.xml-29-25\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1810.05, "y": 1053.35}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18951206_147683_333_0005_alto.xml-72-11", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVid folkh\u00f6gskolan \u00e5 Lunnevad hoppas man p\u00e5 goda frukter af det\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e, som genom detta m\u00f6te gifvits.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18951206_147683_333_0005_alto.xml-72-11\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1802.45, "y": 700.4}, {"color": "#377eb8", "date": "1902", "id": "bib11653811_19020822_145317_127_0002_alto.xml-84-22", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ei \u00d6ved att p\u00e5peka att meningen nied dessa samtal ej kunde vara\u003cbr\u003eatt kritisera afhandlingen utan i st\u00e4llet l\u00e5ta den samma gifva\u003cbr\u003e\u003cb\u003euppslag\u003c/b\u003e till uppbyggligt samtal, hvarp\u00e5 talaren genom ett\u003cbr\u003einneh\u00e5llsrikt yttrande s\u00e4rskildt \u00f6rn de olika platser d\u00e4r katemunerna\u003cbr\u003efostras n\u00e4mligen i hemmet, skolan och lifvet och s\u00f6kte p\u00e5 det s\u00e4tt att\u003cbr\u003ef\u00f6ra diskussionen in p\u00e5 r\u00e4tt str\u00e5t.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1902\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653811_19020822_145317_127_0002_alto.xml-84-22\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1510.1, "y": 1058.85}, {"color": "#377eb8", "date": "1900", "id": "bib11653838_19000413_147024_15_0004_alto.xml-177-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEfter detta \u003cb\u003euppslag\u003c/b\u003e b\u00f6rjade dem emellan ett uth\u00e5llande\u003cbr\u003eteckenspr\u00e5k med h\u00e4nderna, hvarvid framf\u00f6rallt Netta utvecklade en\u003cbr\u003eskicklighet, som m\u00e5ngen af v\u00e5ra landsortsaktriser icke utan sk\u00e4l\u003cbr\u003eskulle haft anledning att afundas henne.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1900\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653838_19000413_147024_15_0004_alto.xml-177-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1620.05, "y": 1215.65}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950607_145112_152_0001_alto.xml-55-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003etamrar beklaga, att detta \u003cb\u003euppslag\u003c/b\u003e misslyckats, kaD p\u00e5\u003cbr\u003egoda sk\u00e4l betviflas.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950607_145112_152_0001_alto.xml-55-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1697.3, "y": 829.6}, {"color": "#377eb8", "date": "1895", "id": "bib19227462_18950504_147640_103_0007_alto.xml-20-32", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eAf de \u00f6friga, mindre styckena behandla n\u00e5gra motiv fr\u00e5n hr\u003cbr\u003eUddgrens bekanta kanotf\u00e4rd fr\u00e5n G\u00f6teborg till Holland \u2014 eller hur\u003cbr\u003el\u00e5ngt det var han nu kom \u2014 andra har han f\u00e5tt \u003cb\u003euppslaget\u003c/b\u003e till\u003cbr\u003eunder sin vistelse i Amerika, och \u00e5ter andra \u00e4ro rena\u003cbr\u003est\u00e4mningsstycken, infall och hvarjehanda bagateller, som han satt i\u003cbr\u003erim och meter p\u00e5 sitt konstiga s\u00e4tt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227462_18950504_147640_103_0007_alto.xml-20-32\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1784.65, "y": 642.2}, {"color": "#377eb8", "date": "1896", "id": "bib15975090_18960314_148377_33_0002_alto.xml-42-14", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI Andra kammaren beviljades anslaget utan diskussion, men i\u003cbr\u003eF\u00f6rsta kammaren gaf fr\u00e5gan \u003cb\u003euppslag\u003c/b\u003e till en principdebatt, under\u003cbr\u003ehvilken \u00e4 ena sidan framh\u00f6lls det egendomliga och oriktiga i att k.\u003cbr\u003em:t icke skall ha den ringaste kontroll \u00f6fver anv\u00e4ndande af det bidrag\u003cbr\u003estaten lemnar, och \u00e5 den andra h\u00e4fdades hush\u00e5llningss\u00e4llskapens\u003cbr\u003esjelfst\u00e4ndighet och uttalades fruktan f\u00f6r statens inblandning i deras\u003cbr\u003everksamhet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15975090_18960314_148377_33_0002_alto.xml-42-14\u003cbr\u003etype: usage\u003c/p\u003e", "x": 2061.5, "y": 786.7}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18951212_147683_339_0006_alto.xml-167-31", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePears annonsdepartement f\u00f6rest\u00e5s,, som sagdt, af mr Barrau och\u003cbr\u003eban bar b\u00e5de bekr\u00e4ftat ordspr\u00e5ket \u00bb man kan ej ruinera sig p\u00e5 att\u003cbr\u003eannonsera \u00bb och gifvit m\u00e5ng\u00e5 nya \u003cb\u003euppslag\u003c/b\u003e \u00e5t\u003cbr\u003eannonseringsv\u00e4sendet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18951212_147683_339_0006_alto.xml-167-31\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1925.3, "y": 658.0}, {"color": "#377eb8", "date": "1897", "id": "bib19227291_18970313_145289_31_0003_alto.xml-12-2", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eatt det \u003cb\u003euppslag\u003c/b\u003e, han nu s\u00f6kt gif 1 f\u00f6rening med konst\u003cbr\u003eoch literatur kommer\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1897\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19227291_18970313_145289_31_0003_alto.xml-12-2\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1444.7, "y": 640.05}, {"color": "#377eb8", "date": "1898", "id": "bib11653790_18980617_145648_46_0008_alto.xml-22-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDuellen med Dellbright var egentligen \u003cb\u003euppslaget\u003c/b\u003e till\u003cbr\u003eRocheforts m\u00e5nga politiska strider.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1898\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18980617_145648_46_0008_alto.xml-22-5\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1257.9, "y": 864.35}, {"color": "#377eb8", "date": "1895", "id": "bib19277277_18950808_147683_213_0006_alto.xml-121-9", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSkolm\u00f6tet 1895 lemnar sitt bidrag i fr\u00e5ga om nya \u003cb\u003euppslag\u003c/b\u003e\u003cbr\u003egenom den b\u00e4r ifr\u00e5gavarande utst\u00e4llningen af pedagogisk literatur, en\u003cbr\u003eutst\u00e4llning som synes vara l\u00e4rorik ocb v\u00e4rde full.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib19277277_18950808_147683_213_0006_alto.xml-121-9\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1583.15, "y": 866.7}, {"color": "#377eb8", "date": "1896", "id": "bib11653790_18960207_145648_6_0002_alto.xml-11-10", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eS\u00e5som man genast ser, har man h\u00e4r f\u00f6r sig \u003cb\u003euppslaget\u003c/b\u003e till\u003cbr\u003eomfattande riksdagsstrider, hvilka icke torde komma att hinna sin\u003cbr\u003eafslutning i br\u00e5dkastet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1896\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib11653790_18960207_145648_6_0002_alto.xml-11-10\u003cbr\u003etype: usage\u003c/p\u003e", "x": 1932.95, "y": 726.1}, {"color": "#377eb8", "date": "1895", "id": "bib15873371_18950606_145112_151_0003_alto.xml-36-5", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eoch H. gjorde nytt \u003cb\u003euppslag\u003c/b\u003e, om han tyckte, att det ej\u003cbr\u003eklang vackert.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1895\u003cbr\u003egrouping: 2\u003cbr\u003eidentifier: bib15873371_18950606_145112_151_0003_alto.xml-36-5\u003cbr\u003e
